import React from 'react';

import { v4 as uuidv4 } from "uuid";
import { projects } from './../data';

import ImgDisplayer from './ImgDisplayer';
import Video from './Video';

const Gallery = ({ leng, displayNav }) => {

    const img = <Video
        title="test"
        input="https://www.youtube.com/embed/7AF7MkNJRT0?rel=0&modestbranding=1&autohide=1&showinfo=0"
    />

    // <img
    //     alt="test"
    //     className="test"
    //     key={uuidv4()}
    //     src={require(`./../assets/photos/animal0.png`)} />

    return <div id="gallery">
        <h1 className="projects">{leng === 'english' ? "Projects" : "Proyectos"}</h1>
        {projects.map(proj =>
            <ImgDisplayer
                key={uuidv4()}
                input={Object.values(proj)[0]}
                displayNav={displayNav}
                leng={leng}
                video={
                    <Video
                        title={Object.keys(proj)}
                        input={Object.values(proj)[0]}
                    />
                } />
        )}
    </div>
}

export default Gallery;
